export const MenuDash = ({ menuOptions }: any) => {

    console.log(menuOptions)
    return (
        <div className="flex flex-col bg-blue-950 p-4">
            <ul className="flex flex-col list-none">
                <li className="flex flex-col text-white text-sm">
                    <span className="cursor-pointer font-semibold">Processos</span>
                    
                    <div className="flex flex-col font-normal text-xs pl-3">
                        <span className="cursor-pointer">Compras</span>
                        <span className="cursor-pointer">Test 1</span>
                        <span className="cursor-pointer">Test 2</span>
                        <span className="cursor-pointer">Test 2</span>
                        <span className="cursor-pointer">Test 3</span>
                    </div>
                </li>
            </ul>
        </div>
    )
}

MenuDash.schema = {
  title: 'Process Examples',
  description: '',
  type: 'object',
  properties: {
    menuOptions: {
      title: 'Options',
      type: 'array',
      menu: [

      ],
   },
  }
}
